using Nethereum.ABI.FunctionEncoding.Attributes;
using Nethereum.Contracts;

namespace Ethereum.Nethereum.SmartContracts.ERC721Mintable.Deployment
{
    internal class DeploymentMessage : ContractDeploymentMessage
    {
        private const string Bytecode = "";

        public DeploymentMessage()
            : base(Bytecode)
        {
        }

        [Parameter("string", "tokenName")]
        public string? TokenName { get; set; }

        [Parameter("string", "tokenSymbol")]
        public string? TokenSymbol { get; set; }
    }
}